import React, { Component } from 'react';

class TimerContainer extends Component{

  render(){
    return(
      <div>
      <div className="ui green inverted segment">Humalog Timer</div>
      <div className="ui green inverted segment">Lantus Timer</div>
      </div>
    )
  }
}

export default TimerContainer
